import React from 'react';
import { TextField } from '@material-ui/core';


const CustomNumField = (props: any): JSX.Element => {
    const { label, name, value, onChange } = props;
    console.log(props)
    return (
        <TextField
            variant="outlined"
            type="number"
            label={label}
            name={name}
            value={value}
            onChange={onChange}
        />
    );
};

export default CustomNumField;
